import React from 'react';
import './UserDashboardPage.css'; // Make sure to link the CSS file
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faSearch, faEnvelope } from '@fortawesome/free-solid-svg-icons';

const UserDashboardPage = () => {
  return (
    <div className="user-dashboard-page">
      <header className="header">
        {/* Profile Icon */}
        <div className="profile-icon">
          <FontAwesomeIcon icon={faUser} className="icon" />
        </div>

        {/* Search Bar */}
        <div className="search-bar">
          <input type="text" placeholder="Search..." />
          <FontAwesomeIcon icon={faSearch} className="search-icon" />
        </div>

        {/* Message Icon */}
        <div className="message-icon">
          <FontAwesomeIcon icon={faEnvelope} className="icon" />
          <span className="message-badge">3</span> {/* Badge for new messages */}
        </div>
      </header>

      {/* Other page content can go here */}
    </div>
  );
};

export default UserDashboardPage;
